import{_ as l,c as t,o as a,ag as i}from"./chunks/framework.26XVkPZQ.js";const o="/gitee_show.png",b=JSON.parse('{"title":"提交作品","description":"","frontmatter":{},"headers":[],"relativePath":"festival/submit.md","filePath":"festival/submit.md"}'),r={name:"festival/submit.md"};function n(s,e,c,d,h,u){return a(),t("div",null,e[0]||(e[0]=[i('<h1 id="提交作品" tabindex="-1">提交作品 <a class="header-anchor" href="#提交作品" aria-label="Permalink to &quot;提交作品&quot;">​</a></h1><h2 id="一、作品二进制文件" tabindex="-1">一、作品二进制文件 <a class="header-anchor" href="#一、作品二进制文件" aria-label="Permalink to &quot;一、作品二进制文件&quot;">​</a></h2><p>作品提交时间为2025年8月4日~比赛结束。<strong>提交表单在后文</strong>。</p><p>有任何问题，请添加<a href="https://godothub.com/intro/community" target="_blank" rel="noreferrer">官方群</a>工作人员的<strong>微信/QQ</strong>或直接在群里问。</p><ol><li>您至少应该上传游戏的Linux和Windows的x86_64架构Release导出。</li></ol><blockquote><p><code>Release导出</code>意味着导出时<code>取消勾选</code>【调试导出】按钮。作品需要在openKylin 2.0的x64架构机器上正常运行，提交作品后会有社区小伙伴帮助测试，并及时与参赛者反馈结果。</p></blockquote><ol start="2"><li>Godot引擎一般可以直接在Windows平台导出Linux作品。</li></ol><blockquote><p>若使用了native相关库或功能，且不能交叉编译的，需自行配置虚拟机或真机进行编译。有技术问题可以在<a href="https://godothub.com/forum" target="_blank" rel="noreferrer">论坛发帖</a>或群里询问。</p></blockquote><ol start="3"><li>为了能在Linux平台运行，游戏应在导出Linux时切换为兼容性最佳的选项。</li></ol><blockquote><p>就是新建项目时的那个兼容性选项，新建项目后也可以在编辑器右上角随时修改。</p></blockquote><ol start="4"><li><p>提交的压缩包名称、压缩包内的文件夹名称、压缩包内的文件名称等，都仅允许使用英文半角字母、半角数字、半角横杠-和半角下划线_。</p></li><li><p>除作品本体外，还应提供：作品名称（中英文），作品图标，作品简介（8~28字），详细介绍（字数15+），运行截图（3~6张），版本号，包名，分类等信息。</p></li><li><p>提交表单既允许多次提交，也允许修改已提交的。</p><ul><li>多个作品请多次报名，并以不同队伍名多次提交作品。</li><li>已提交的作品需要修改或更新的，直接找到提交记录进行修改，请勿重复提交！</li><li>提交时需要提供Gitee ID，请参考下方<code>注册Gitee ID</code>步骤，不要填错！</li><li>先提交作品，后续再提交代码（但Gitee要先注册）。</li></ul></li></ol><blockquote><p>注：群内以“赛务组2025”为群名称前缀的，即为工作人员。私聊工作人员一天后未获得响应的，应当直接在官方群内询问。</p></blockquote><h3 id="提交表单" tabindex="-1">提交表单 <a class="header-anchor" href="#提交表单" aria-label="Permalink to &quot;提交表单&quot;">​</a></h3><ul><li>提交前必须完整阅读比赛规则和本页面的信息。</li><li>您需要同意遵守比赛规则、并按步骤进行提交。</li><li>请点击该<a href="https://f.wps.cn/ksform/w/write/HPvRsY7a" target="_blank" rel="noreferrer">提交表单</a>进行作品提交。</li><li>作品太大、无法直接上传的，请私聊工作人员解决。</li></ul><h2 id="二、作品开源代码" tabindex="-1">二、作品开源代码 <a class="header-anchor" href="#二、作品开源代码" aria-label="Permalink to &quot;二、作品开源代码&quot;">​</a></h2><p>根据参赛规则第五条，您需要在官方指定的Gitee仓库内开源参赛作品主体代码。</p><ul><li>非全部代码，亦不包含作品使用的素材资源等。</li><li>建议您完全开源所有代码和素材，为开源事业助力！</li><li>开源仓库必须选择开源协议，一般主流的均可。</li></ul><h3 id="_1-注册gitee" tabindex="-1">1. 注册Gitee <a class="header-anchor" href="#_1-注册gitee" aria-label="Permalink to &quot;1. 注册Gitee&quot;">​</a></h3><p>注册<a href="https://gitee.com" target="_blank" rel="noreferrer">Gitee账号</a>，该账号在提交时使用。</p><div class="danger custom-block"><p class="custom-block-title">什么是Gitee ID？</p><p style="text-align:center;"><img src="'+o+'" style="width:50%;"></p></div><h3 id="_2-签署cla" tabindex="-1">2. 签署CLA <a class="header-anchor" href="#_2-签署cla" aria-label="Permalink to &quot;2. 签署CLA&quot;">​</a></h3><p>签署<a href="https://cla.openkylin.top" target="_blank" rel="noreferrer">开源贡献者协议(CLA)</a>。</p><ul><li>必须用与Gitee账号相同的邮箱、以及<code>Gitee ID</code>进行签署。</li><li>提交作品时也需要填写<code>Gitee ID</code>，请勿填错！</li><li>之前已签署的账号无需重复签署。</li></ul><h3 id="_3-提交代码" tabindex="-1">3. 提交代码 <a class="header-anchor" href="#_3-提交代码" aria-label="Permalink to &quot;3. 提交代码&quot;">​</a></h3><p>提交代码到<code>指定Gitee仓库</code>。</p><ul><li>为方便统一管理，工作人员会为您新建仓库并设置相关权限。</li><li>提交作品后，工作人员会根据提交表单里的信息为您新建仓库，并设置维护者权限（一般三天内）。</li><li>已经新建完成的仓库会在本页面公示，请随时关注。</li></ul><h2 id="三、提交web导出-推荐" tabindex="-1">三、提交Web导出（推荐） <a class="header-anchor" href="#三、提交web导出-推荐" aria-label="Permalink to &quot;三、提交Web导出（推荐）&quot;">​</a></h2><p>这一步骤是可选的。提交Web导出将得到更多流量展示。</p><ul><li>导出时，可执行文件名字用<code>index</code>（最终得到<code>index.html</code>）</li><li>必须取消勾选调试导出。</li><li>会在官网进行展示。</li></ul>',29)]))}const _=l(r,[["render",n]]);export{b as __pageData,_ as default};
